app.on('ready', () => {
  console.log('[Pinokio] Ready')
  createWindow()
  setTimeout(startOpenClaw, 3000)
})

app.on('window-all-closed', () => {
  if (process.platform !== 'darwin') {
    stopOpenClaw()
    app.quit()
  }
})

app.on('before-quit', () => {
  stopOpenClaw()
})
